import React from 'react';
// import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Users from './UsersPage';
import Posts from './PostsPage';


class App extends React.Component{
//     constructor(props){
//       super(props);
//       this.state = {users: []};
//     }
//     componentDidMount(){
//       anxios.get('https://jsonplaceholder.typicode.com/todos/1').then((result)=>this.setState({
//         users: result.data
//       }))

//     }
    render(){
      return(
        <div className="App">
          <Router>
            <div>
              <Nav />
              <Switch>
                <Route exactly component={Users} path="./UsersPage" />
                <Route exactly component={Posts} path="./PostsPage" />
              </Switch>
            </div>
          </Router>
        </div>
      )
    }
  }

export default App;
